import { useSelector } from "react-redux"
import User from "./User"

const UserList = () => {
  const users = useSelector((state) => state.allUsers)

  return (
    <div>
      <h2>All users</h2>
      <p>blogs created {user.blogs.length}</p>
      {users.map((user) => (
        <li key={user.id}>
          <User user={user} />
        </li>
      ))}
    </div>
  )
}

export default UserList
